local textures = {
    ["ssg08"] = draw.CreateTexture( common.RasterizeSVG( imgs["ssg08"][3] ) ),
    ["scar20"] = draw.CreateTexture( common.RasterizeSVG( imgs["scar20"][3] ) ),
    ["g3sg1"] = draw.CreateTexture( common.RasterizeSVG( imgs["g3sg1"][3] ) ),
    ["awp"] = draw.CreateTexture( common.RasterizeSVG( imgs["awp"][3] ) ),
    ["deagle"] = draw.CreateTexture( common.RasterizeSVG( imgs["deagle"][3] ) ),
    ["revolver"] = draw.CreateTexture( common.RasterizeSVG( imgs["revolver"][3] ) )
}

local ref = gui.Reference( "Visuals","Overlay","Weapon" )
local enable = gui.Checkbox( ref, "dormant_wp.chk", "Dormant Esp", true )
enable:SetDescription("Show dormant weapons with text.")
local clr = gui.ColorPicker( enable, "dormant_wp.clr", "clr", 255, 0, 0, 200 )
local show_img = gui.Checkbox( ref, "dormant_wp.img", "Show Texture", true )
show_img:SetDescription("Show weapon texture.")
local esp_in_dis = gui.Checkbox( ref, "dormant_wp.esp_all", "Esp In Distance", true )
esp_in_dis:SetDescription("Only esp weapons in distance.")
local distance_cancel = gui.Slider( ref, "dormant_wp.distance", "Esp Max Distance", 2500, 1000, 5000,250 )
distance_cancel:SetDescription("Esp max distance.")
local blinking = gui.Checkbox( ref, "dormant_wp.blink", "Alpha Blinking", true )
distance_cancel:SetDescription("Alpha blinking.")
local cus_font_name = gui.Editbox( ref, "dormant_wp,cus_font.name", "Custom Font Name" )
local cus_font_size = gui.Slider( ref, "dormant_wp,cus_font.size", "Custom Font Size", 0, 0, 50,0.5 )
local cus_font_thickness = gui.Slider( ref, "dormant_wp,cus_font.thickness", "Custom Font Thickness", 0, 0, 1000,200 )

local support_weapons = {
    ["ssg08"] = "SSG08",
    ["scar20"] = "[CT]Scar20",
    ["g3sg1"] = "[T]G3sg1",
    ["awp"] = "AWP",
    ["deagle"] = "Deagle",
    ["revolver"] = "R8"
}

local font = draw.CreateFont( "Verdana", 17.5, 600 )

local function ReCreateFont(name,size,thickness)
    font = draw.CreateFont( name, size, thickness )
end

local function ApllyFont()
    if cus_font_size:GetValue() ~= 0 and cus_font_thickness:GetValue() ~= 0 then
        ReCreateFont(cus_font_name:GetValue(),tonumber(cus_font_size:GetValue()),tonumber(cus_font_thickness:GetValue()))
    end
end 

local aplly_font = gui.Button( ref, "Aplly", function()
    ApllyFont()
end )

local function VecTable(v)
    return { v.x,v.y,v.z }
end

local function clamp(min,v,max)
    if v <= min then
        return min,true
    elseif v >= max then
        return max,true
    end
    return v,false
end

local add = -1
local function Draw_Dormants()

    distance_cancel:SetInvisible(false)
    local pass = false
    if not esp_in_dis:GetValue() then
        distance_cancel:SetInvisible(true)
        pass = true
    end

    local lplayer = entities.GetLocalPlayer()
    if lplayer and enable:GetValue() then
        local lorigin = lplayer:GetAbsOrigin()
        local all_entities = entities.FindByClass( "CWeaponCSBase" )

        draw.SetFont(font)
        local r,g,b,a = clr:GetValue()


        if blinking:GetValue() then
            local alpha,result = clamp(0,a,220)
            if result == true then
                add = add * -1
            end

            alpha = alpha + add
            a = alpha
            clr:SetValue(r,g,b,a)
        end

        draw.Color(r,g,b,a)
        for i = 1,#all_entities do
            local entity = all_entities[i]

            if entity and entity:IsDormant() and entity:GetPropInt("m_hPrevOwner") ~= -1 then
                local origin = entity:GetAbsOrigin()
                local distance = vector.Distance( VecTable(lorigin), VecTable(origin) )
 
                if pass or distance < distance_cancel:GetValue() then
                    local name = entity:GetName()
                    if string.find(name,"weapon") then
                        name = string.gsub(name,"weapon_","")
                        if support_weapons[name] ~= nil then
                            local x,y = client.WorldToScreen( origin )

                            if x and y then
                                if show_img:GetValue() then
                                    local icon = imgs[name]
                                    local texture = textures[name]
                                    draw.SetTexture( texture )
                                    draw.FilledRect( x - icon[1] / 2, y + icon[2] / 2, x + icon[1] / 2, y + icon[2] * 1.5 )
                            end

                                name = support_weapons[name]
                                local sizex,sizey = draw.GetTextSize( name )
                                draw.TextShadow( x - sizex / 2,y - sizey / 2,name )
                            end
                        end
                    end
                end
            end
        end
    end
end
callbacks.Register( "Draw" , Draw_Dormants )